(37, 'Income Tax', 'Income tax is levied on the income of individuals, companies, and associations.\r\nIndividuals are categorized into different tax brackets based on their income levels.\r\nEmployers deduct income tax at source (tax withheld) from employees\' salaries.\r\nSelf-employed individuals and businesses are required to file income tax returns annually.\r\nIndividuals, companies, and businesses must file tax returns annually by the specified due date.\r\nUse the online tax portal provided by the Federal Board of Revenue (FBR) or submit physical tax returns to the designated tax offices.\r\nFor further assistance or inquiries, please visit the Federal Board of Revenue website or contact your nearest tax office.', 34, 1, '2024-04-16 21:34:33', '2024-04-16 21:34:33'),
(38, 'Property Tax', 'Property tax is imposed on the ownership of immovable property such as land, buildings, and residential/commercial units.\r\nLocal authorities administer property tax, and rates may vary across different regions.', 34, 1, '2024-04-16 21:34:33', '2024-04-16 21:34:33'),
(39, 'Customs Duty', 'Customs duty is levied on goods imported into Pakistan.\r\nRates of customs duty vary depending on the type and value of the imported goods.', 34, 1, '2024-04-16 21:34:33', '2024-04-16 21:34:33'),
(40, 'Sales Tax', 'Sales tax is imposed on the sale of goods and services within Pakistan.\r\nRegistered businesses collect sales tax from their customers and deposit it with the government.', 34, 1, '2024-04-16 21:34:33', '2024-04-16 21:34:33');

